import AuthPage from "./component/AuthPage";
import GroupsPage from "./component/GroupsPage";


export const mainRouter = [
    {
        path: "/login",
        Component: <AuthPage/>
    },
    {
        path: "/registration",
        Component: <AuthPage/>
    },
    {
        path: "/groups",
        Component: <GroupsPage/>
    },
]
